import Navbar from './Components/Navbar.js';
import Crossfade from './Components/Crossfade.js';
import Menubar from './Components/Menubar.js';
import SearchBar from './Components/SearchBar';


function App() {
  return (
    <>
    <div>
      <Menubar/>
      <SearchBar/>
      <Crossfade/>  
    </div>
    </>
  );
}

export default App;
